import UtilityCalculations from './components/UtilityCalculations'
import './App.css';

const App = ()=> {

  const [data, setData] = useState([])

  const getData=()=>{
    fetch('data.json',{headers:{
      'content-type':'application/json',
      'Accept':'application/json'
    }}).then((response)=>{
      return response.json()
    }).then((myjson)=>{
      setData(myjson)
    })
  }
  useEffect(()=>{
    getData()
  }, [])

return(
  <div>
  {/* {data.map(item=>(
    <h1 key={item}>{item.Alcohol}</h1>
  ))} */}
  {data.map(items=>(
    <UtilityCalculations items={items}/>
  ))}
  </div>
)

}
export default App
